  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Roanoke
  River National Wildlife Refuge summarizes Refuge activities during the 1994 calendar
  year.  The report begins with a summary of the yearu2019s highlights and climatic
  conditions.  Land acquisition is also covered.  The report includes a planning section
  which discusses research and investigations.  Refuge administration is outlined;
  information about personnel, volunteer programs, funding, safety, and technical
  assistance is given.  Habitat management is also covered.  Subjects include wetlands,
  Farmeru2019s Home Administration Conservation Easements, and private lands.  The
  wildlife section of the report discusses wildlife diversity, endangered species,
  threatened species, waterfowl, marsh birds, water birds, raptors, game mammals,
  fisheries resources, and marking/banding.  The public uses of the Refuge described
  in this report include interpretive exhibits, hunting, camping, and law enforcement.
  \ The equipment and facilities section of the report provides information about
  major maintenance, communications systems, and computer systems.  Cooperative programs
  and items of interest are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
